// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadCourData(char *Buffer)
{
    memcpy(Buffer, &CourL0[1], CourL0[0] << 2);
    Buffer += (CourL0[0] << 2);

    memcpy(Buffer, &CourL1[1], CourL1[0] << 2);
    Buffer += (CourL1[0] << 2);

    memcpy(Buffer, &CourB[1], CourB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char CourName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillCourData(void)
{
    remove(CourName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteCourData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(CourName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, CourName)) return "";
    #endif

    if (!(han = fopen(CourName, "wb"))) return "";
    if (AutoClean) atexit(KillCourData);

    num = fwrite(&CourL0[1], 4, CourL0[0], han);
    if (num != CourL0[0]) {fclose(han); return "";}

    num = fwrite(&CourL1[1], 4, CourL1[0], han);
    if (num != CourL1[0]) {fclose(han); return "";}

    num = fwrite(&CourB[1], 1, CourB[0], han);
    if (num != CourB[0]) {fclose(han); return "";}

    fclose(han);
    return CourName;
}

